  false,\n\t\"url\": null,\n\t\"notes\": \"The Canadian ROPOS remotely operated vehicle
  (ROV) outfitted with video equipment (and other devices) was deployed from the NOAA
  Ship McAurthurII during May-June 2006 in an attempt to document the presence of
  critical hard bottom benthic habitats believed to exist in the waters of the Olympic
  Coast national marine sanctuary (OCNMS). Video data from specific dives falling
  within the bounds of the HMPR-118-2005-03c survey area were reviewed to describe
  various benthic characteristics as a tool for validating sonar imagery.Video mosaics
  were created from selected sections of video to assist with sonar image groundtruthing.\",\n\t\"owner_org\":
